import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import { BrowserRouter, Route, Switch } from 'react';
function App() {
    return (
      <div>
        <BrowserRouter>
        <div>
          <Switch>
            <Route path="/" exact render={
              ()=> (<Home></Home>)
            }></Route>
            {/* <Route path="/create/wod" exact Component={CreateWodRoute}></Route> */}
          </Switch>

        </div>

        </BrowserRouter>
      </div>

    );
}

export default App;
